void MMS_HE_displacement(double *u, double t, double X, double Y, double Z)
{

  u[0] = (X*X)*Y*Z*(Y*2.0-1.0)*(cos(M_PI*(1.0/4.0)-t*1.0E3)/(t*1.0E3+1.0)-sqrt(2.0)*(1.0/2.0))*pow(X-1.0,2.0)*(Y-1.0)*(Z-1.0)*-1.0E1;
  u[1] = X*(Y*Y)*Z*(X*2.0-1.0)*(cos(M_PI*(1.0/4.0)-t*1.0E3)/(t*1.0E3+1.0)-sqrt(2.0)*(1.0/2.0))*(X-1.0)*pow(Y-1.0,2.0)*(Z-1.0)*1.0E1;
  u[2] = X*Y*Z*(cos(M_PI*(1.0/4.0)-t*1.0E3)/(t*1.0E3+1.0)-sqrt(2.0)*(1.0/2.0))*(X-1.0)*(Y-1.0)*(Z-1.0)*(-1.0/1.0E2);
}

void MMS_HE_velocity(double *v, double t, double X, double Y, double Z)
{

  v[0] = (X*X)*Y*Z*(Y*2.0-1.0)*pow(X-1.0,2.0)*(Y-1.0)*(Z-1.0)*(cos(M_PI*(1.0/4.0)-t*1.0E3)*1.0/pow(t*1.0E3+1.0,2.0)*1.0E3-(sin(M_PI*(1.0/4.0)-t*1.0E3)*1.0E3)/(t*1.0E3+1.0))*1.0E1;
  v[1] = X*(Y*Y)*Z*(X*2.0-1.0)*(X-1.0)*pow(Y-1.0,2.0)*(Z-1.0)*(cos(M_PI*(1.0/4.0)-t*1.0E3)*1.0/pow(t*1.0E3+1.0,2.0)*1.0E3-(sin(M_PI*(1.0/4.0)-t*1.0E3)*1.0E3)/(t*1.0E3+1.0))*-1.0E1;
  v[2] = X*Y*Z*(X-1.0)*(Y-1.0)*(Z-1.0)*(cos(M_PI*(1.0/4.0)-t*1.0E3)*1.0/pow(t*1.0E3+1.0,2.0)*1.0E3-(sin(M_PI*(1.0/4.0)-t*1.0E3)*1.0E3)/(t*1.0E3+1.0))*(1.0/1.0E2);
}

void MMS_HE_initial_velocity(double *v, double X, double Y, double Z)
{
  MMS_HE_velocity(v, 0.0, X, Y, Z);
}

void MMS_HE_pressure_volume(double *P, double *V, ELASTICITY *elast, double t, double X, double Y, double Z)
{
  double xUx11 = X*Y*Z*(Z-1.0)*(X*-3.0+(X*X)*2.0+1.0)*(Y*-3.0+(Y*Y)*2.0+1.0)*-2.0E1;
  double xUx21 = (Y*Y)*Z*pow(Y-1.0,2.0)*(Z-1.0)*(X*-6.0+(X*X)*6.0+1.0)*1.0E1;
  double xUx31 = Y*Z*(X*2.0-1.0)*(Y-1.0)*(Z-1.0)*(-1.0/1.0E2);
  double xUx12 = (X*X)*Z*pow(X-1.0,2.0)*(Z-1.0)*(Y*-6.0+(Y*Y)*6.0+1.0)*-1.0E1;
  double xUx22 = X*Y*Z*(Z-1.0)*(X*-3.0+(X*X)*2.0+1.0)*(Y*-3.0+(Y*Y)*2.0+1.0)*2.0E1;
  double xUx32 = X*Z*(Y*2.0-1.0)*(X-1.0)*(Z-1.0)*(-1.0/1.0E2);
  double xUx13 = (X*X)*Y*(Z*2.0-1.0)*pow(X-1.0,2.0)*(Y*-3.0+(Y*Y)*2.0+1.0)*-1.0E1;
  double xUx23 = X*(Y*Y)*(Z*2.0-1.0)*pow(Y-1.0,2.0)*(X*-3.0+(X*X)*2.0+1.0)*1.0E1;
  double xUx33 = X*Y*(Z*2.0-1.0)*(X-1.0)*(Y-1.0)*(-1.0/1.0E2);
  double tU = cos(M_PI*(1.0/4.0)-t*1.0E3)/(t*1.0E3+1.0)-sqrt(2.0)*(1.0/2.0);
  double eJ = tU*xUx11+tU*xUx22+tU*xUx33+(tU*tU)*xUx11*xUx22-(tU*tU)*xUx12*xUx21+(tU*tU)*xUx11*xUx33-(tU*tU)*xUx13*xUx31+(tU*tU)*xUx22*xUx33-(tU*tU)*xUx23*xUx32+(tU*tU*tU)*xUx11*xUx22*xUx33-(tU*tU*tU)*xUx11*xUx23*xUx32-(tU*tU*tU)*xUx12*xUx21*xUx33+(tU*tU*tU)*xUx12*xUx23*xUx31+(tU*tU*tU)*xUx13*xUx21*xUx32-(tU*tU*tU)*xUx13*xUx22*xUx31+1.0;

  double dudJ = 0.0;
  elast->compute_dudj(&dudJ, eJ);
  *P = dudJ*elast->mat->kappa;
  *V = eJ;
}

